// note: this index isn't guaranteed to remain stable over restarts, so
// persist gLanguages[index/gTranslationsCount] instead
int GetLanguageIndex(LANGID id)
{
    switch (id) {
#define _LANGID(lang) MAKELANGID(lang, SUBLANG_NEUTRAL)
    case MAKELANGID(LANG_ENGLISH, SUBLANG_ENGLISH_US): return 0;
    case MAKELANGID(LANG_CHINESE, SUBLANG_CHINESE_SIMPLIFIED): return 43;
    case _LANGID(LANG_FRENCH): return 86;
    case _LANGID(LANG_GERMAN): return 129;
    case _LANGID(LANG_HUNGARIAN): return 172;
    case _LANGID(LANG_ITALIAN): return 215;
    case MAKELANGID(LANG_PORTUGUESE, SUBLANG_PORTUGUESE_BRAZILIAN): return 258;
    case _LANGID(LANG_PORTUGUESE): return 301;
    case _LANGID(LANG_RUSSIAN): return 344;
    case _LANGID(LANG_UKRAINIAN): return 387;
    default: return -1;
#undef _LANGID
    }
}

